import Header from './components/Header/Header'
import SideBarNav from './components/SideBarNav/SideBarNav';

let document_title = "Untitled design - Employees"


const CreateCardLayout: React.FC = () => {

    return (
        <div className=" overflow-y-auto  h-full ">
            <div>

                <Header document_title={document_title} />
            </div>
            <div className="w-full mx-auto grid grid-cols-12 font-inter h-full">
                <div className="col-span-2  h-full">
                    <SideBarNav />
                </div>
                <div className="col-span-3 overflow-y-auto h-full">
                    qw  qw
                </div>
                <div className="col-span-7 overflow-hidden  overscroll-y-none  h-full">
                    qw  qw
                </div>
            </div>


        </div>


    )

};

export default CreateCardLayout;
